        assembly {
            let result
            // Add some code here
            if lt(x, 5)
            {
                result:= mul(x, y)
            }
            // let result := mul (x, y)
            // let result1:= "hello world"
            mstore(0x0, result)
            return (0x0, 32)
        }
    }

    function t(uint n) public view returns(uint)
    {
        assembly {
            let value:= 1
            // lt=less than
            for { let i:= 0 } lt(i, n) {   i:= add(i, 1) }
            {
                value:= mul(2, value)
            }
            mstore(0x0, value)
            return (0x0, 32)
        }
    }
}

